const webInterface = `
<html>
    <title>Codeometer</title>
    <head>
        <meta charset="UTF-8">
    </head>

    <style>
        h1 {
            text-shadow: 2px 2px black;
        }
        body {
            overflow: hidden;
        }
        .single-info {
            background: gray;
            color: white;
            font-weight: bold;
            font-family: Courier;
        }
        .info {
            background: gray;
            color: white;
            font-weight: bold;
            font-family: Courier;
            height: 36%;
            overflow-y: auto;
        }
        .error {
            background: red;
            color: white;
            font-weight: bold;
            font-family: Courier;
        }
        .copyright {
            display: table;
            width: 100%;
            height: 1px;
        }
        .copyright-disclaimer {
            bottom: 2%;
            height: 1px;
            align: center;
            display: table-cell;
            font-size: 11px;
            text-align: right;
            font-family: Courier;
            color: gray;
        }
        .wait {
            width: 100%;
            height: 100%;
            background: gray;
            color: white;
            font-weight: bold;
            font-family: Courier;
        }
    </style>

    <script>
        function doRequest(vdoc, userData, method) {
            try {
                chkKM = document.getElementById("chkKM");
                chkMI = document.getElementById("chkMI");
                chkM = document.getElementById("chkM");
                chkMM = document.getElementById("chkMM");
                if (!chkKM.checked && !chkMI.checked && !chkM.checked && !chkMM.checked) {
                    document.getElementById("console").className = "error";
                    document.getElementById("console").innerHTML = "You must select at least one unit of measurement.";
                    return;
                }
                var form = document.createElement("form");
                form.method = method;
                form.action = vdoc;
                for (let k in userData) {
                    if (userData.hasOwnProperty(k)) {
                        const field = document.createElement("input");
                        field.type = "hidden";
                        field.name = k;
                        field.value = userData[k];
                        form.appendChild(field);
                    }
                }
                fieldMeasures = document.createElement("input");
                fieldMeasures.type = "hidden";
                fieldMeasures.name = "measures";
                var measures = [{checkbox:chkKM, label:"km"}, {checkbox:chkMI, label:"mi"},
                                {checkbox:chkM, label:"m"}, {checkbox:chkMM, label: "mm"}];
                for (m = 0; m < measures.length; m++) {
                    if (measures[m].checkbox.checked) {
                        if (fieldMeasures.value.length) {
                            fieldMeasures.value += ",";
                        }
                        fieldMeasures.value += measures[m].label;
                    }
                }
                form.appendChild(fieldMeasures);
                fieldFontSize = document.createElement("input");
                fieldFontSize.type = "hidden";
                fieldFontSize.name = "fontSize";
                fontSize = document.getElementById("fontSize");
                fieldFontSize.value = fontSize.options[fontSize.selectedIndex].text;
                form.appendChild(fieldFontSize);
                fieldExts = document.createElement("input");
                fieldExts.type = "hidden";
                fieldExts.name = "exts";
                fieldExts.value = document.getElementById("edtExt").value;
                form.appendChild(fieldExts);
                chkEstimatives = document.getElementById("chkEstimatives");
                fieldEstimatives = document.createElement("input");
                fieldEstimatives.type = "hidden";
                fieldEstimatives.name = "estimatives";
                if (chkEstimatives.checked) {
                    fieldEstimatives.value = "1";
                } else {
                    fieldEstimatives.value = "0";
                }
                form.appendChild(fieldEstimatives);
                chkStatsPerFile = document.getElementById("chkStatsPerFile");
                fieldStatsPerFile = document.createElement("input");
                fieldStatsPerFile.type = "hidden";
                fieldStatsPerFile.name = "statsPerFile";
                if (chkStatsPerFile.checked) {
                    fieldStatsPerFile.value = "1";
                } else {
                    fieldStatsPerFile.value = "0";
                }
                form.appendChild(fieldStatsPerFile);
                moreDivField = document.createElement("input");
                moreDivField.type = "hidden";
                moreDivField.name = "moreDiv";
                moreDivField.value = document.getElementById("moreDiv").style.display;
                form.appendChild(moreDivField);
                document.body.appendChild(form);
                form.submit();
                document.getElementById("mainDiv").style.display = "none";
                document.getElementById("waitDiv").style.display = "block";
            } catch(e) {
                document.getElementById("console").className="error";
                document.getElementById("console").innerHTML = e.toString();
            }
        }
        function doUrlMeasure() {
            edtQuery = document.getElementById("edtQuery");
            if (edtQuery.value.length > 0) {
                doRequest("/codeometer", { "src" : edtQuery.value }, "post");
            }
        }
        function doFileMeasure() {
            try {
                btnBrowse = document.getElementById("btnBrowse");
                btnBrowse.onchange = function () {
                    if (btnBrowse.files.length == 0) {
                        return;
                    }
                    var file = btnBrowse.files[0];
                    var reader = new FileReader();
                    if (btnBrowse.value.endsWith(".zip")) {
                        reader.readAsBinaryString(file);
                    } else {
                        reader.readAsText(file);
                    }
                    reader.addEventListener("load", function (e) {
                                                        doRequest("/codeometer", { "src" : btnBrowse.value,
                                                                                   "data" : window.btoa(e.target.result)}, "post")
                                                    });
                }
                btnBrowse.click();
            } catch(e) {
                document.getElementById("console").className="error";
                document.getElementById("console").innerHTML = e.toString();
            }
        }
        function keyListener(e) {
            e = e || window.event;
            if (e.keyCode == 13) {
                doUrlMeasure();
            }
        }
        function showMoreDiv() {
            document.getElementById("moreDiv").style.display = "block";
        }
        function hideMoreDiv() {
            document.getElementById("moreDiv").style.display = "none";
        }
    </script>
    <div class="wait" id="waitDiv" style="display: none">
        <div style="position: absolue; bottom: 50%;">
            <center>wait...</center>
            <img src="{{.statusImage}}" width="100%" height="100%">
        </div>
    </div>
    <body>
        <div id="mainDiv">
            <input type="file" id="btnBrowse" style="visibility:hidden" accept="*.*"/>
            <center>
                <img src="data:image/jpeg;base64,">
                <div class="single-info">
                    <h1>Codeometer</h1>
                </div>
                <table border = 0 style="font-family: Courier">
                    <tr>
                        <td>
                            <input type="text" id="edtQuery" size=100 placeholder="Type a git-repo url and click measure or click open and select a zipped project or a source file." onkeydown="keyListener(event);" value="{{.edtQuery}}">
                        </td>
                        <td>
                            <input type="button" id="btnMeasure" size=20 value="Measure" onclick="doUrlMeasure();">
                        </td>
                        <td>
                            <input type="button" id="btnUpload" size=20 value="Open..." onclick="doFileMeasure();">
                        </td>
                        <td>
                            <input type="button" id="btnUpload" size=20 value="Config..." onclick="showMoreDiv();">
                        </td>
                    </tr>
                </table>
                <div id="moreDiv" style="display: {{.moreDiv}}; font-family: Courier">
                    <table border = 0>
                        <tr>
                            <td>
                                <input type="text" id="edtExt" size=76% placeholder="Type all relevant file extensions present in the project (eg.: c, h, etc)." value="{{.edtExt}}">
                            </td>
                            <td>
                                <input type="checkbox" id="chkEstimatives" {{.chkEstimatives}}> Estimatives
                            </td>
                            <td>
                                <input type="checkbox" id="chkStatsPerFile" {{.chkStatsPerFile}}> Stats per file
                            </td>
                        </tr>
                        <tr>
                            <td>
                                Measure &nbsp;
                                <input type="checkbox" id="chkKM" {{.chkKM}}> km &nbsp;
                                <input type="checkbox" id="chkMI" {{.chkMI}}> mi &nbsp;
                                <input type="checkbox" id="chkM" {{.chkM}}> m &nbsp;
                                <input type="checkbox" id="chkMM" {{.chkMM}}> mm &nbsp;
                            </td>
                            <td>
                                Font size &nbsp;
                                <select id="fontSize" placeholder="Select a font size">
                                    <option value="12px" {{.fontSize12px}}>12px</option>
                                    <option value="10px" {{.fontSize10px}}>10px</option>
                                </select>
                            <td>
                                <input type="button" id="btnOk" style="padding: 0% 45%" value="Ok" onclick="hideMoreDiv();">
                            </td>
                        </tr>
                    </table>
                </div>
            </center>
            <div class="{{.div-type}}" id="console">
                {{.info}}
            </div>
       </div>
       <div class="copyright">
          <div class="copyright-disclaimer">
            (C) Copyright 2020 by Rafael Santiago
          </div>
       </div>
    </body>
</html>
`

